INSERT INTO `pit_comments` (`pit_scout_data_id`, `team_number`, `pit_comments`, `scouter_name`, `timestamp`) VALUES
(1, 3971, 'Kai orbus \r\nThey have a very weak 2 wheel drive. Their gear mech doesn\'t work very well, and they were having battery issues. They have a climber. 10- 12 seconds on climb, take with a grain of salt. Put an uncharged battery in their bot. No cheesecake', 'Chris Dauber', '2017-03-18 16:26:12'),
