(3, 4291, 'Tank drive, velcro climber', 'Colin Evans', '2017-03-18 17:40:04'),
(4, 6334, 'Tank drive, shoots high in auto but not great accuracy,  can do gears', 'Colin Evans', '2017-03-18 17:46:09'),
